import React from 'react';
import { ScrollView, StyleSheet, TextInput, View, Text, TouchableOpacity } from 'react-native';
import { Button, Card } from 'react-native-paper';
import { DefaultTheme } from 'react-native-paper';



function Login ( {navigation} ) {
  return (
 
    <View style={styles.container}>
        
        <Text>
            Login with UC Davis Email
        </Text>
        <View>
            <TouchableOpacity style={styles.button} mode="contained" onPress={() => navigation.navigate('SecondScreen')}>
                <Text>
                    CAS LOGIN
                </Text>
            </TouchableOpacity>
        </View>
    </View>
    

    
  )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'column',
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },

    image :{
        marginBottom: 40
    },
    
    TextInput: {
        height: 50,
        flex: 1,
        padding: 10,
        marginLeft: 20,
    },
    button: {
        backgroundColor: "#FFBF1C",
        textAlign: 'center',
        padding: 10,
        width: '50%',
        borderRadius: 15,
    }
     
});

export default Login
